import React from "react";
import Card from "../UI/Card";
import  classes from "./in.module.css"


const In=()=>{

    return(
        <Card>
<form className={classes.form}>
                <div >
                    <label htmlFor='title'>Title</label>
                    <input type="text" id="title" className={classes.control} required  />
                </div>
                </form>
                </Card>
    );
}
export default In;
